  false,\n\t\"url\": null,\n\t\"notes\": \"The coming of the tanker terminal at Valdez
  and the pending development of oil and gas resources on the outer continental shelf
  threaten massive change for seabirds in the Gulf of Alaska often overlooked, however,
  is the fact that man has already effected a change in status for any of these birds.
  In this paper I will examine the scanty, general record from the exploratory period,
  roughly 1741 to 1936, and the somewhat more comprehensive record of the reconnaissance
  period, 1936-1974, and attempt to develop a basis for better understanding of the
  change in seabird status that has already taken place. This paper should be treated
  as a verbal model which can be improved as our knowledge of seabirds in the Gulf
  of Alaska is expanded.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
